import React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';



function AddCustomDish() {


    return (
        <Box
            sx={{
                display: 'flex',
                flexDirection: 'column',
                '& .MuiTextField-root': { width: '45ch' },
                margin: '30px',
            }}
        >
            <Card>
                <CardContent>
                    <CardMedia
                        component="img"
                        height="300"
                        image='https://res.cloudinary.com/crunchbase-production/image/upload/c_lpad,f_auto,q_auto:eco,dpr_1/v1479829522/bxpgav8mvdsibvxctd1d.jpg'
                        alt="" />
                    <TextField label={'Dish title'} id="margin-none" multiline margin={'20px'} />
                    <br />
                    <TextField label={'Dish description...'} id="margin-dense" multiline margin={'20px'} />
                </CardContent>
                <Stack margin={'20px'}>
                    <Button variant="contained" onClick={() => console.log('clik')} > Add Custom Dish </Button>
                </Stack>
            </Card >
        </Box >
    )
}


export default AddCustomDish;
